const extractor=()=>({get_posts:async function(page=1,request=null,args=null){return await request.get({url:"https://en.wikipedia.org/w/api.php?action=query&list=random&rnnamespace=0&rnlimit=12&format=json"}).then((res=>res.data)).then((data=>data.query.random)).then((posts=>posts.map((post=>({title:post.title,author:"Wikipedia",url:`https://en.m.wikipedia.org/?curid=${post.id}`,id:post.id,dt:null,image:"/images/bitmap_dark.png",page:"/discover/wikipedia/"+post.id}))))).catch((err=>[]))},get_post:async function(id,request=null,args=null){return await request.get({url:`https://en.wikipedia.org/w/api.php?action=query&format=json&prop=info&pageids=${id}`}).then((res=>res.data)).then((data=>data.query.pages[String(id)])).then((post=>({title:post.title,author:"Wikipedia",url:"https://en.wikipedia.org/?curid="+id,id:id,dt:null,image:"/images/bitmap_dark.png",page:"/discover/wikipedia/"+id}))).catch((err=>null))}});